//
// Create and drop tables for testing and production
//
const Pool = require("pg").Pool;
const bcrypt = require("bcrypt");
const fs = require("fs-extra");
require("dotenv").config({
  // Load envarioment variables for development or production
  path:
    process.env.NODE_ENV === "production"
      ? ".env.production"
      : ".env.development"
});

var PUBLIC_PATH;
if (process.env.NODE_ENV === "production") {
  // Set Production variables
  PUBLIC_PATH = "dist"; // HTML files
} else {
  // Set Develpmnet variables
  PUBLIC_PATH = "public"; // HTML files
}

// Connect to database
const pool = new Pool({
  connectionString: process.env.DATABASE_URL
});
pool.on("connect", () => {
  console.log("## Connected to the database ##");
});

//
// TABLES;
//

const tableUsers = `
CREATE TABLE IF NOT EXISTS users (
  id SERIAL PRIMARY KEY,
  username VARCHAR(25) NOT NULL UNIQUE CHECK (LENGTH(username) > 0),
  email VARCHAR(255) NOT NULL UNIQUE CHECK (LENGTH(email) > 0),
  password VARCHAR(255) NOT NULL CHECK (LENGTH(password) >= 8),
  security_level VARCHAR(20) NOT NULL DEFAULT 'user',
  created_date TIMESTAMPTZ NOT NULL DEFAULT CURRENT_TIMESTAMP
);
`;

const tableProjects = `
CREATE TABLE IF NOT EXISTS projects (
  id SERIAL PRIMARY KEY,
  user_id INTEGER,
  username VARCHAR(25) NOT NULL,
  projectname VARCHAR(30) NOT NULL CHECK (LENGTH(projectname) > 0),
  projectimage BYTEA,
  project JSONB DEFAULT NULL,
  updated_date TIMESTAMPTZ NOT NULL,
  created_date TIMESTAMPTZ NOT NULL DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (user_id) REFERENCES users(id)
);
`;

//
//  FUNCTIONS;
//

const resetTables = async () => {
  try {
    // Drop tables
    await pool.query("DROP TABLE IF EXISTS projects");
    await pool.query("DROP TABLE IF EXISTS users");
    // Create Tables
    await pool.query(tableUsers);
    console.log("## TABLE USERS HAS BEEN RESET ##");
    await pool.query(tableProjects);
    console.log("## TABLE RPOJECTS HAS BEEN RESET ##");

    //
    // Delete all apps
    //
    fs.emptyDirSync(`../${PUBLIC_PATH}/apps`);
  } catch (err) {
    console.log(err.stack);
  }
};

const resetTablesWithData = async () => {
  try {
    await resetTables();

    // Username with demos:
    const demosUser = "demos";

    // Hash user password
    const salt = await bcrypt.genSalt();
    const hashPassowrd = await bcrypt.hash("password", salt);
    await pool.query(
      `INSERT INTO users (username, email, password) 
        VALUES ('${demosUser}', 'jerom@example.com', '${hashPassowrd}')`
    );
    await pool.query(
      `INSERT INTO users (username, email, password, security_level) 
        VALUES ('admin', 'admin@example.com', $1, 'admin')`,
      [hashPassowrd]
    );
    console.log("## USERS HAVE BEEN ADDED ##");

    //
    // ADD DEMO PROJECTS
    //

    // Create demos username folder
    fs.mkdirSync(`../${PUBLIC_PATH}/apps/${demosUser}`);

    // Add demo video player (with screen)
    await pool.query(
      `INSERT INTO projects (user_id, username, projectname, projectimage, project, updated_date)
        VALUES (1, '${demosUser}', 'videoplayerscreen', decode('${videoplayerscreenImage}','base64'),
        $1, NOW());`,
      [JSON.stringify(simpleVideoPlayerScreen)]
    );
    fs.copySync(
      `../${PUBLIC_PATH}/demos/videoplayerscreen`,
      `../${PUBLIC_PATH}/apps/${demosUser}/videoplayerscreen`
    ); // Copy folder data

    // Add demo video player (no screen)
    await pool.query(
      `INSERT INTO projects (user_id, username, projectname, projectimage, project, updated_date)
        VALUES (1, '${demosUser}', 'videoplayer', decode('${videoplayerImage}','base64'),
        $1, NOW());`,
      [JSON.stringify(simpleVideoPlayer)]
    );
    fs.copySync(
      `../${PUBLIC_PATH}/demos/videoplayer`,
      `../${PUBLIC_PATH}/apps/${demosUser}/videoplayer`
    ); // Copy folder data

    // Add demo temperature sensor
    await pool.query(
      `INSERT INTO projects (user_id, username, projectname, projectimage, project, updated_date)
        VALUES (1, '${demosUser}', 'tempcontroller', decode('${tempControllerImage}','base64'),
        $1, NOW());`,
      [JSON.stringify(simpleTempController)]
    );
    fs.copySync(
      `../${PUBLIC_PATH}/demos/tempcontroller`,
      `../${PUBLIC_PATH}/apps/${demosUser}/tempcontroller`
    ); // Copy folder data

    // Add demo button project
    await pool.query(
      `INSERT INTO projects (user_id, username, projectname, projectimage, project, updated_date)
        VALUES (1, '${demosUser}', 'button', decode('${buttonImage}','base64'),
        $1, NOW());`,
      [JSON.stringify(simpleButton)]
    );
    fs.copySync(
      `../${PUBLIC_PATH}/demos/button`,
      `../${PUBLIC_PATH}/apps/${demosUser}/button`
    ); // Copy folder data

    // Add demo led project
    await pool.query(
      `INSERT INTO projects (user_id, username, projectname, projectimage, project, updated_date)
        VALUES (1, '${demosUser}', 'led', decode('${ledImage}','base64'),
        $1, NOW());
      `,
      [JSON.stringify(simpleLED)]
    );
    fs.copySync(
      `../${PUBLIC_PATH}/demos/led`,
      `../${PUBLIC_PATH}/apps/${demosUser}/led`
    ); // Copy folder data

    // await pool.query(
    //   `INSERT INTO projects (user_id, username, projectname, projectimage, project, updated_date)
    //    VALUES (2, 'admin', 'pikachu', decode('${buttonImage}','base64'),
    //    '${JSON.stringify(simpleButton)}', NOW());`
    //   // `INSERT INTO projects (user_id, username, projectname, projectimage, project, updated_date)
    //   //  VALUES (2, 'admin', 'charmander', pg_read_binary_file('demo1.png'),
    //   //  '{"project": "Hello Admin World"}', NOW());`
    // );
    console.log("## PROJECTS HAVE BEEN ADDED ##");
  } catch (err) {
    console.log(err.stack);
  }
};

